var text =
   '#h4Vaccine ingredients do not cause autism.\n\n' +
   'One vaccine ingredient that has been studied specifically is [thimerosal](https://www.cdc.gov/vaccinesafety/concerns/thimerosal/faqs.html), a mercury-based preservative used ' +
   'to prevent contamination of multidose vials of vaccines. Research shows that thimerosal does not cause ASD. In fact, ' +
   '[a 2004 scientific review by the IOM](https://www.nap.edu/catalog/10997/immunization-safety-review-vaccines-and-autism) concluded that' +
   '"the evidence favors rejection of a causal relationship between thimerosal–containing vaccines and autism." Since 2003, there have been ' +
   '[nine CDC-funded or conducted studies](https://www.cdc.gov/vaccinesafety/pdf/cdcstudiesonvaccinesandautism.pdf) that have found no link between thimerosal-containing ' +
   'vaccines and ASD, as well as no link between the measles, mumps, and rubella (MMR) vaccine and ASD in children.\n\n'; +
   'Between 1999 and 2001, thimerosal was removed or reduced to trace amounts in all childhood vaccines except for some flu vaccines. This was done as part of a broader ' +
   'national effort to reduce all types of mercury exposure in children before studies were conducted that determined that thimerosal was not harmful. It was done as a precaution. ' +
   'Currently, the only childhood vaccines that contain thimerosal are flu vaccines packaged in multidose vials. Thimerosal-free alternatives are also available for flu vaccine. ' +
   'For more information, see the [Timeline for Thimerosal](https://www.cdc.gov/vaccinesafety/concerns/thimerosal/timeline.html) in Vaccines.\n\n' +
   'Besides thimerosal, some people have had concerns about [other vaccine ingredients](https://www.cdc.gov/vaccines/vac-gen/additives.htm) in relation to ASD as well. ' +
   'However, no links have been found between any vaccine ingredients and ASD.\n\n' +
   'Source:  cdc.gov\n';
